--  DDL for Trigger LIMITAR_DEPARTAMENTOS
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "USERDB"."LIMITAR_DEPARTAMENTOS" 
BEFORE INSERT ON departamentos
FOR EACH ROW
DECLARE
  v_count NUMBER;
BEGIN
  -- Contar el número actual de departamentos
  SELECT COUNT(*) INTO v_count FROM departamentos;

  -- Si ya existen 10 departamentos, se lanza un error
  IF v_count >= 10 THEN
