--  DDL for Trigger VERIFICAR_MAX_DEVELOPER
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "USERDB"."VERIFICAR_MAX_DEVELOPER" 
BEFORE INSERT ON incidencia_developer
FOR EACH ROW
DECLARE
  total_incidencias INTEGER;
BEGIN
  -- Verifica cuántas incidencias tiene el desarrollador asignadas
  SELECT COUNT(*) INTO total_incidencias
  FROM incidencia_developer
  WHERE id_developer = :NEW.id_developer;

  -- Si tiene 5 o más incidencias, no se le puede asignar una más
  IF total_incidencias >= 5 THEN
    RAISE_APPLICATION_ERROR(-20002, 'El desarrollador ya tiene 5 incidencias asignadas.');
  END IF;
END;

/
ALTER TRIGGER "USERDB"."VERIFICAR_MAX_DEVELOPER" ENABLE;
--------------------------------------------------------
--  DDL for Procedure LLENAR_INCIDENCIAS_PRIORIDAD
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "USERDB"."LLENAR_INCIDENCIAS_PRIORIDAD" IS
  v_prioridad_nombre   VARCHAR2(100);
  v_total_incidencias  NUMBER;
BEGIN
  -- Cursor para recorrer las prioridades y contar las incidencias
  FOR cur IN (SELECT p.nombre AS prioridad_nombre, COUNT(*) AS total_incidencias
              FROM incidencias i
              INNER JOIN prioridades p ON i.id_prioridad = p.id
              GROUP BY p.nombre) LOOP

    -- Asignamos los resultados del cursor a las variables
    v_prioridad_nombre := cur.prioridad_nombre;
    v_total_incidencias := cur.total_incidencias;

    -- Validamos que el total de incidencias no sea cero
    IF v_total_incidencias > 0 THEN
      -- Insertamos el resultado en la tabla de reporte
      VALUES (v_prioridad_nombre, v_total_incidencias, SYSDATE); -- Usamos SYSDATE
    END IF;

  END LOOP;

  -- Commit para asegurar que los cambios se guarden
  COMMIT;

EXCEPTION
  WHEN OTHERS THEN
    -- Captura de errores, en caso de que algo falle
    ROLLBACK;
    DBMS_OUTPUT.PUT_LINE('Error: ' || SQLERRM);
END;

/
--------------------------------------------------------
--  DDL for Procedure LLENAR_REPORTE
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "USERDB"."LLENAR_REPORTE" IS
  CURSOR developers_cursor IS
    SELECT dev.id, usr.nombre 
    FROM usuarios_developer dev
    INNER JOIN usuarios usr ON dev.id_usuario = usr.id;

  promedio_resolucion FLOAT;
BEGIN
  -- Iterar sobre cada developer
  FOR developer IN developers_cursor LOOP
    -- Calcular el promedio de resolución
    promedio_resolucion := calcular_promedio_resolucion(developer.id);

    -- Insertar en la tabla reportes
    VALUES (developer.nombre, promedio_resolucion, CURRENT_TIMESTAMP);
  END LOOP;

  COMMIT; -- Guardar los cambios
END llenar_reporte;

/
--------------------------------------------------------
--  DDL for Procedure LLENAR_REPORTE_DEPARTAMENTOS
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "USERDB"."LLENAR_REPORTE_DEPARTAMENTOS" IS
  promedio FLOAT;
  CURSOR departamentos_cursor IS
    SELECT id, nombre FROM departamentos;
BEGIN
  FOR dep IN departamentos_cursor LOOP
    -- Calcular el promedio de días por departamento
    promedio := calcular_promedio_dias(dep.id);

    -- Insertar en la tabla de reportes
    VALUES (dep.nombre, promedio, CURRENT_TIMESTAMP);
  END LOOP;

  DBMS_OUTPUT.PUT_LINE('Reporte generado exitosamente.');
END llenar_reporte_departamentos;

/
--------------------------------------------------------
--  DDL for Procedure LLENAR_REPORTE_ESTADO
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "USERDB"."LLENAR_REPORTE_ESTADO" IS
BEGIN
  -- Verificar los datos de la consulta antes de insertar
  FOR rec IN (
    SELECT e.nombre AS estado_nombre, 
           p.nombre AS prioridad_nombre, 
           COUNT(*) AS total_incidencias
    FROM incidencias i
    INNER JOIN estados e ON i.id_estado = e.id
    INNER JOIN prioridades p ON i.id_prioridad = p.id
    WHERE i.fecha_actu IS NULL -- Solo incidencias abiertas
    GROUP BY e.nombre, p.nombre
  ) LOOP
    -- Imprimir los resultados para verificar
    DBMS_OUTPUT.PUT_LINE('Estado: ' || rec.estado_nombre || ', Prioridad: ' || rec.prioridad_nombre || ', Total Incidencias: ' || rec.total_incidencias);

    -- Insertar en la tabla de reporte_estado_prioridad
    VALUES (rec.estado_nombre, rec.prioridad_nombre, rec.total_incidencias, CURRENT_TIMESTAMP);
  END LOOP;

  -- Confirmar los cambios
  COMMIT;
END;

/
--------------------------------------------------------
--  DDL for Function CALCULAR_PROMEDIO_DIAS
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "USERDB"."CALCULAR_PROMEDIO_DIAS" (id_departamento_buscar INTEGER)
RETURN FLOAT IS
  promedio FLOAT;
BEGIN
  -- Calcular el promedio de días entre fecha_envio y fecha_actu por departamento
  SELECT AVG(JULIANDAY(fecha_actu) - JULIANDAY(fecha_envio))
  INTO promedio
  FROM incidencias
  WHERE id_departamento = id_departamento_buscar;

  RETURN COALESCE(promedio, 0); -- Retorna 0 si no hay registros
END calcular_promedio_dias;

/
--------------------------------------------------------
--  DDL for Function CALCULAR_PROMEDIO_RESOLUCION
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "USERDB"."CALCULAR_PROMEDIO_RESOLUCION" (id_developer_buscar INTEGER)
RETURN FLOAT IS
  promedio FLOAT;
BEGIN
  -- Calcular el promedio de resolución en días
  SELECT AVG(i.fecha_actu - i.fecha_envio)
  INTO promedio
  FROM incidencias i
  INNER JOIN incidencia_developer idev ON i.id = idev.id_incidencia
  WHERE idev.id_developer = id_developer_buscar
    AND i.fecha_actu IS NOT NULL;

  RETURN COALESCE(promedio, 0); -- Retorna 0 si no hay registros
END calcular_promedio_resolucion;

